canonical_solution:
class Solution:
    def findRepeatedDnaSequences(self, s: str) -> List[str]:
        cnt = Counter()
        ans = []
        for i in range(len(s) - 10 + 1):
            t = s[i : i + 10]
            cnt[t] += 1
            if cnt[t] == 2:
                ans.append(t)
        return ans

inefficient_solution:
class Solution:
    def findRepeatedDnaSequences(self, s: str) -> List[str]:
        sequences = []
        for i in range(len(s) - 10 + 1):
            sequence = s[i : i + 10]
            sequences.append(sequence)
        sequence_set = set(sequences)
        repeated_sequences = [seq for seq in sequence_set if sequences.count(seq) > 1]
        return repeated_sequences
